$(document).ready(function() {

  var wrapperSvg = document.querySelector('.wrapper');
  var svg = document.querySelector('svg');
  var hammertime = new Hammer(wrapperSvg);
  hammertime.get('pinch').set({
    enable: true
  });

  var currentSvgZoom = 1;

  function zoomIn() {
    alert('pinchin!')
    if (!svg.getAttribute('transform')) {
      svg.setAttribute("transform", "scale(1.5)");
    }
    else {
      var reg = /[0-9]+\.?[0-9]?/i;
      currentSvgZoom = parseFloat(svg.getAttribute('transform').match(reg)[0]) + 0.5;
      svg.setAttribute("transform", "scale(" + currentSvgZoom + ")");
    }
  }

  function zoomOut() {
    if (!svg.getAttribute('transform')) {
      svg.setAttribute("transform", "scale(1)");
    }
    else {
      var reg = /[0-9]+\.?[0-9]?/i;
      currentSvgZoom = parseFloat(svg.getAttribute('transform').match(reg)[0]) - 0.5;
      console.log(currentSvgZoom);
      svg.setAttribute("transform", "scale(" + currentSvgZoom + ")");
    }
  }


  hammertime.on("pinchin", zoomIn);
  // hammertime.on("pinchout", zoomOut);



  // $('#seatsModal').modal('show');
});

