function getAngle(p1, p2) {


  // angle in radians
  var angleRadians = Math.atan2(p2.y - p1.y, p2.x - p1.x);

  // angle in degrees
  var angleDeg = Math.atan2(p2.y - p1.y, p2.x - p1.x) * 180 / Math.PI;
  return angleDeg;

}

function getStagePoint(stage) {
  var arr = new Array();
  var d = new Object()
  d.x = stage.x
  d.y = stage.y
  arr.push(jQuery.extend(true, {}, d));
  d.x += stage.width
  arr.push(jQuery.extend(true, {}, d));
  d.y += stage.height
  arr.push(jQuery.extend(true, {}, d))
  d.x -= stage.width
  arr.push(jQuery.extend(true, {}, d))
  //console.log("----")
  //console.log(arr)
  return arr;
}

function getVerts(area_path, s_x, s_y) {
  var dat = new Array();
  for (var i = 0; i < area_path.length; i++) {
    var oneDot = new Object();
    oneDot.x = Number(s_x) + Number(area_path[i].m_x)
    oneDot.y = Number(s_y) + Number(area_path[i].m_y)
    dat.push(oneDot)
  }

  return dat;
}

