function isEventSupported(eventName) {
  var el = document.createElement('div');
  eventName = 'on' + eventName;
  var isSupported = (eventName in el);
  if (!isSupported) {
    el.setAttribute(eventName, 'return;');
    isSupported = typeof el[eventName] == 'function';
  }
  el = null;
  return isSupported;
}
var wheelEvent = isEventSupported('mousewheel') ? 'mousewheel' : 'wheel';
$("#wrapper").on(wheelEvent, function(e) {
  e.preventDefault();
  var oEvent = e.originalEvent,
    delta = oEvent.deltaY || oEvent.wheelDelta;
  if (delta > 0) {
    growDown(oEvent);
  } else {
    growUp(oEvent)
  }

});

function compute2DPolygonCentroid(vertices) {
  var vertexCount = vertices.length
  var centroid = new Object();
  centroid.x = 0;
  centroid.y = 0;
  var signedArea = 0.0;
  var x0 = 0.0; // Current vertex X
  var y0 = 0.0; // Current vertex Y
  var x1 = 0.0; // Next vertex X
  var y1 = 0.0; // Next vertex Y
  var a = 0.0; // Partial signed area

  // For all vertices except last
  var i = 0;
  for (i = 0; i < vertexCount - 1; ++i) {
    x0 = vertices[i].x;
    y0 = vertices[i].y;
    x1 = vertices[i + 1].x;
    y1 = vertices[i + 1].y;
    a = x0 * y1 - x1 * y0;
    signedArea += a;
    centroid.x += (x0 + x1) * a;
    centroid.y += (y0 + y1) * a;
  }

  // Do last vertex separately to avoid performing an expensive
  // modulus operation in each iteration.
  x0 = vertices[i].x;
  y0 = vertices[i].y;
  x1 = vertices[0].x;
  y1 = vertices[0].y;
  a = x0 * y1 - x1 * y0;
  signedArea += a;
  centroid.x += (x0 + x1) * a;
  centroid.y += (y0 + y1) * a;

  signedArea *= 0.5;
  centroid.x /= (6.0 * signedArea);
  centroid.y /= (6.0 * signedArea);

  var rect = document.createElementNS(svgNS, 'rect');
  rect.setAttribute('x', centroid.x);
  rect.setAttribute('y', centroid.y);
  rect.setAttribute('width', 5);
  rect.setAttribute('height', 5);
  rect.setAttribute('fill', '#00FF00');
  svg.appendChild(rect);


  return centroid;
}



